import React from "react";
import Navbar from "./Navbar";
import NavPage from "./NavPage";
import Sidebar from './Sidebar'

const MainPage = () => {
  return (
    <React.Fragment>
      {/* heading section */}
      <section>
        <div>
          <Navbar />
        </div>
      </section>

      {/* sidebar section */}
      <section>
        <div className="d-flex">
          <div className="col-2 ">
              <Sidebar/>
          </div>


          <div className="col-10">
              <NavPage className=''/>
          </div>
        </div>
      </section>
    </React.Fragment>
  );
};

export default MainPage;
